import React from 'react';
import './App.css';
// import MemberPanel from "./member/memberPanel";
// import MatchPanel from "./match/matchPanel";
import CivPanel from "./techtree/civPanel";
import TreePanel from "./techtree/panels/treePanel";
import Tree from "./techtree/panels/tree";
import {range, townCentre, defense, barracks, stable, castle, siege, monastery, blacksmith, university, economy, dock} from "./techtree/panels/UNIT_NAMES";

var CURRENT_CIV = "Aztecs";

function App() {
  var x = new Tree();
  return (
    <div className="App">
      <h4> AGE OF EMPIRES 2 TECHNOLOGY TREE </h4>
      <div>
        <CivPanel />
        <table>
          <tbody>
            <tr>
            <TreePanel build="Archery Range" tree={range}/>
            <TreePanel build="Barracks" tree={barracks}/>
            <TreePanel build="Stable" tree={stable}/>
            </tr>
            <tr>
            <TreePanel build="Siege Workshop" tree={siege}/>
            <TreePanel build="Castle" tree={castle}/>
            <TreePanel build="Defense" tree={defense}/>
            </tr>
            <tr>
            <TreePanel build="Blacksmith" tree={blacksmith}/>
            <TreePanel build="University" tree={university}/>
            <TreePanel build="Monastery" tree={monastery}/>
            </tr>
            <TreePanel build="Town Center" tree={townCentre}/>
            <TreePanel build="Economic Buildings" tree={economy}/>
            <TreePanel build="Dock" tree={dock}/>
          </tbody>
        </table>




      </div>
    </div>
  );
}

export default App;
